import React from "react";

const Video = ({ video, onVote, onRemove }) => {
  return (
    <div className="video">
      <h2>{video.title}</h2>
      <iframe
        title={video.title}
        width="560"
        height="315"
        src={`https://www.youtube.com/embed/${video.url}`}
        frameBorder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowFullScreen
      ></iframe>

      <p>Votes: {video.votes}</p>
      <button onClick={() => onVote(video.id, "up")}>Up Vote</button>
      <button onClick={() => onVote(video.id, "down")}>Down Vote</button>
      <button onClick={() => onRemove(video.id)}>Remove</button>
    </div>
  );
};

export default Video;
